class List extends Component {
    constructor(props) {
        super(props)
        this.getList = this.getList.bind(this)
        this.state = {
            url: theUrl + '/getAdminList'
        }
    }
    componentDidMount() {
        this.getList(this.props.dispatch, this.state.url)
    }   

    getList = (dispatch, getAdminList) => {

        fetch(getAdminList)
        .then(res => { return res.json() })
        .then(res => {
            dispatch({
                type: 'INIT',
                res
            })
            console.log(res)
        })
    }

    render() {
        return(
            <div>
                {this.props.list.map((item, index)=>
                    <ul>
                        <li key={index}>{item.username}</li>
                    </ul>
                ) }
            </div>
        )
    }
}

const mapStateToProps = state => ({
    list: state.list
})

export default connect(
    mapStateToProps
)(List);
